"""
Given a string, s, return the total number of substring within s that contain the same character.
Note: You may assume that s only contains lowercase alphabetical characters.

Ex: Given the following string sâ€¦

s = "aabca", return 6 ("a" appears 3 times, "aa" appears 1 time, "b" appears 1 time, and "c" appears 1
time).
"""


from itertools import groupby


class Solution:
    def countHomogenous(self, s: str) -> int:
        res = 0
        for _, s in groupby(s):
            n = len(list(s))
            res += n * (n + 1) / 2
        return int(res % (10**9 + 7))


# Test Cases
if __name__ == "__main__":
    sol = Solution()
    print(sol.countHomogenous("aabca"))  # 6
    print(
        sol.countHomogenous(
            ""
        )
    )  # 49965
